import React from 'react'

const Listusers = ({ props }) => {
    return (
      <div className="centrado">
        {props.map((user, i) => {
          return (
            <div  className="color "key={i}>

            <ul>
              <li>
                <p>{user.name}</p>
              </li>
            </ul>
            </div>
          );
        })}
      </div>
    );
  };
export default Listusers
